import { Container } from "@mui/system";
import { Carousel } from "bootstrap";
import React from "react";
import CarouselDiv from "./Carousel/CarouselDiv";
import Topbar from "./TopBar/Topbar";
function Home() {
  return (
    <>
      <header>
        <Topbar />
      </header>
      <Container maxWidth='xl'
      sx={{height:'50vh'}}>
            <CarouselDiv/>
      </Container>
    </>
  );
}

export default Home;
